import React from 'react'
import { Menu, Layout } from 'antd';
import styled from 'styled-components'

const { Header } = Layout;

const StyledHeader = styled(Header)`
    display: flex;
    padding: 12px;
    padding-left: 20px;
    padding-right: 20px;
    height: 70px;
    width: 100%;
    background-color: rgba(255,255,255,0.5);
    position: sticky;
    z-index: 5;
    top: 0;
`;

const MenuLogoContainer = styled.div`
    display: flex;
    flex-direction: row;
    flex: 1;
    justify-content: space-between;
    width: 100%;
    align-items: center;
`;

const MenuStyled = styled(Menu)`
    display: flex;
    flex-direction: row;
    flex: 1;
    justify-content: flex-end;
`

const NavBarItemMain = styled(Menu.Item)`
    font-family: 'Benton Bold';
    background-color: #FFCB05 !important;
    border-radius: 15px;
    transition: 0.3s;
    padding-top: 2px !important;
    &:hover {
        opacity: 0.7;
    }
`
const NavBarItem = styled(NavBarItemMain)`
    background-color: rgba(0,0,0,0) !important;
    font-family: 'Benton Medium';
`

const Navbar: React.FC = () => {
    return (
        <StyledHeader>
            <MenuLogoContainer>
                <a href={'/'}>
                    <img height={40} src={require('../../assets/images/logo.png')} alt={"MasterSeats Logo"}/>
                </a>
                <MenuStyled>
                    <NavBarItemMain>
                        Home
                    </NavBarItemMain>
                    <div style={{width: 20}}/>
                    <NavBarItem>
                        Login
                    </NavBarItem>
                    <div style={{width: 5}}/>
                    <NavBarItem>
                        Sign Up
                    </NavBarItem>
                </MenuStyled>
            </MenuLogoContainer>
        </StyledHeader>
    )
}

export default Navbar
